import React, { useState, useRef, useEffect } from "react";
import { Fps } from "./Fps.tsx";
import { svgInk } from "../freehand/svgInk.ts";
import { Vec } from "../freehand/Vec.ts";

const canvasSize = 600;

type Point = [number, number];
type Line = {
  dots: Point[];
  color: string;
  width: number;
};

function getCoordinates(e: React.MouseEvent | React.TouchEvent) {
  const canvas = document.querySelector("#html5-canvas") as HTMLCanvasElement;
  const rect = canvas.getBoundingClientRect();
  const k = canvasSize / rect.width;

  if ("touches" in e) {
    const touch = e.touches[0] || e.changedTouches[0];
    return {
      x: (touch.clientX - rect.left) * k,
      y: (touch.clientY - rect.top) * k,
    };
  } else {
    return {
      x: (e.clientX - rect.left) * k,
      y: (e.clientY - rect.top) * k,
    };
  }
}

export function SimpleCanvasHTML5() {
  const canvasRef = useRef<HTMLCanvasElement>(null);
  const [isDrawing, setIsDrawing] = useState(false);
  const [currentLine, setCurrentLine] = useState<Point[]>([]);
  const [lines, setLines] = useState<Line[]>(aLotOfLines);

  // Redraw canvas when lines or current line changes
  useEffect(() => {
    let start = Date.now();
    const canvas = canvasRef.current;
    if (!canvas) return;

    const ctx = canvas.getContext("2d");
    if (!ctx) return;

    // Clear canvas
    ctx.clearRect(0, 0, canvasSize, canvasSize);
    ctx.fillStyle = "#f6eee2";
    ctx.fillRect(0, 0, canvasSize, canvasSize);

    // Draw existing lines
    lines.forEach((line) => {
      const svgPath = svgInk(
        line.dots.map(([x, y]) => new Vec(x, y)),
        { size: line.width },
      );

      ctx.fillStyle = line.color;
      const path = new Path2D(svgPath);
      ctx.fill(path);
    });

    // Draw current line being drawn
    if (currentLine.length >= 2) {
      const svgPath = svgInk(
        currentLine.map(([x, y]) => new Vec(x, y)),
        { size: 8 },
      );

      ctx.fillStyle = "#000000";
      const path = new Path2D(svgPath);
      ctx.fill(path);
    }
    console.log(Date.now() - start, "ms");
  }, [lines, currentLine]);

  const startDrawing = (e: React.MouseEvent | React.TouchEvent) => {
    e.preventDefault();
    const { x, y } = getCoordinates(e);
    setCurrentLine([[x, y]]);
    setIsDrawing(true);
  };

  const draw = (e: React.MouseEvent | React.TouchEvent) => {
    if (!isDrawing) return;
    e.preventDefault();
    const { x, y } = getCoordinates(e);
    setCurrentLine((prev) => [...prev, [x, y]]);
  };

  const stopDrawing = (e?: React.TouchEvent) => {
    if (!isDrawing) return;
    if (e) e.preventDefault();

    if (currentLine.length > 1) {
      setLines((prev) => [
        ...prev,
        {
          dots: currentLine,
          color: "#000000",
          width: 8,
        },
      ]);
    }
    setCurrentLine([]);
    setIsDrawing(false);
  };

  const clearCanvas = () => {
    console.log(
      JSON.stringify(
        lines.map((l) => {
          return {
            ...l,
            dots: l.dots.map(([x, y]) => {
              return [+x.toFixed(1), +y.toFixed(1)];
            }),
          };
        }),
      ),
    );
    setLines([]);
    setCurrentLine([]);
    setIsDrawing(false);
  };

  return (
    <div style={{ padding: "20px", textAlign: "center" }}>
      <Fps />
      <h2>HTML5 Canvas Version (Simple)</h2>
      <p>Basic Canvas 2D + svgInk implementation</p>

      <button
        onClick={clearCanvas}
        style={{
          marginBottom: "20px",
          padding: "10px 20px",
          backgroundColor: "#ff4444",
          color: "white",
          border: "none",
          borderRadius: "4px",
          cursor: "pointer",
        }}
      >
        Clear Canvas
      </button>

      <div
        style={{
          margin: "0 auto",
          maxWidth: "500px",
          maxHeight: "100%",
          height: "auto",
          aspectRatio: "1 / 1",
          display: "flex",
          justifyContent: "center",
        }}
      >
        <canvas
          ref={canvasRef}
          id="html5-canvas"
          width={canvasSize}
          height={canvasSize}
          onMouseDown={startDrawing}
          onMouseMove={draw}
          onMouseUp={stopDrawing}
          onMouseLeave={stopDrawing}
          onTouchStart={startDrawing}
          onTouchMove={draw}
          onTouchEnd={stopDrawing}
          onTouchCancel={stopDrawing}
          style={{
            touchAction: "none",
            border: "2px dashed #ccc",
            cursor: "crosshair",
            aspectRatio: "1 / 1",
            maxWidth: "100%",
            height: "auto",
          }}
        />
      </div>
    </div>
  );
}

